    useEffect(() => {
        axios.get('http://127.0.0.1:8000/posts/')
        .then(res => {setPosts(res.data);
        })
    }, [])  

    console.log(posts)


    return (   
        <div className="mainClass">
            {(posts===undefined)?(''):(posts.map(post => 
                <div>
                    <li></li>
                </div>
            ))}
            
        </div>
    )
}



